`survey03`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '如果您是老板,希望给自己开多少薪水？' ,
`survey04`  int(5) NULL DEFAULT NULL COMMENT '您的职业？1学生 2公司职员 3自由职业者 4无业' ,
`survey05`  int(5) NULL DEFAULT NULL COMMENT '您的年龄？ 1_15-18 2_19-25 3_26-35 4_35以上' ,
`survey06`  int(11) NULL DEFAULT NULL COMMENT '您每月的收入(生活费)大约多少？ 1_0-2,000 2_2,000-5,000 3_5,000-10,000 4_10,000以上' ,
`survey07`  int(5) NULL DEFAULT NULL COMMENT '您平时的工作(学习)压力大吗？ 1很大 2大 3一般 4阶段性' ,
`survey08`  int(5) NULL DEFAULT NULL COMMENT '您感觉压力大的时候最想做些什么？ 1逛街购物 2寻找美食 3旅游 4聚会 5以上都有' ,
`survey09`  int(5) NULL DEFAULT NULL COMMENT '您习惯用哪些工具上网？ 1电脑 2手机 3平板 4以上都有' ,
`survey10`  int(5) NULL DEFAULT NULL COMMENT '您一天的上网时间？ 1_1-2小时 2_3-5小时 3_5-8小时 4_8小时以上' ,
`survey11`  int(5) NULL DEFAULT NULL COMMENT '您通常上网都做些什么？ 1聊天/刷微博/网购 2听音乐/看电影或其他视频 3逛论坛/浏览新闻 4工作需要 5以上都有' ,
`survey12`  int(5) NULL DEFAULT NULL COMMENT '您是否关注互联网发展动态？ 1很关注 2偶尔关注 3不关注' ,
`survey13`  int(5) NULL DEFAULT NULL COMMENT '您所从事的行业？ 1IT互联网 2金融/房地产 3批发和零售业 4教育/文化体育/娱乐业 5其他' ,
`survey14`  int(5) NULL DEFAULT NULL COMMENT '您所在公司是否有自己的门户网站？ 1有 2没有' ,
`survey15`  int(5) NULL DEFAULT NULL COMMENT '您所偏爱的网站风格？ 1简洁大方 2时尚酷炫 3像我们官网那样' ,
`survey16`  int(5) NULL DEFAULT NULL COMMENT '您觉得网页中的大写加粗该怎么写？' ,
`survey17`  int(5) NULL DEFAULT NULL COMMENT '您是否有认识的程序员？ 1是 2否' ,
`survey18`  int(5) NULL DEFAULT NULL COMMENT '程序员给您的最大印象？1严谨认真,无所不能 2思维活跃,技术狂热 3年轻多斤,死宅 4老实聪明,不善交际' ,
