`mail`  varchar(55) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '邮箱' ,
`create_time`  datetime NULL DEFAULT NULL ,
PRIMARY KEY (`id`)
)
